import {NavLink} from 'react-router-dom';

const Menu = () =>{
    return(
        <>
        <NavLink exact activeClassName="active_class" to='/'>
             About Us
        </NavLink>
        <NavLink exact activeClassName="active_class" to='/contact'> 
        Contact Us
        </NavLink>

        {/*<a href ='/' > AboutUS </a>
        <a href ='/contact' > ContactUS </a>*/}

        </>
    );
};

export default Menu;
